import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [loggedIn, setLoggedIn] = useState(false);
  const [userData, setUserData] = useState(null);

  const handleLogin = async () => {
    try {
      const response = await axios.get('http://localhost:5000/login'); // Update URL if needed
      setUserData(response.data);
      setLoggedIn(true);
    } catch (error) {
      console.error('Error logging in:', error);
    }
  };

  const LOGIN_URL = "http://localhost:5000/login"; // Update if needed

  return (
    <div
      style={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        height: "100vh",
        width: "100vw",
        backgroundColor: "#191414",
        color: "white",
      }}
    >
      <h1 style={{ fontSize: "3rem", marginBottom: "2rem" }}>
        Spotify Analyzer
      </h1>
      <p style={{ marginBottom: "2.5rem" }}>
        Zaloguj się, aby zobaczyć swoje statystyki.
      </p>
      <button
        onClick={handleLogin}
        style={{
          padding: "15px 30px",
          borderRadius: "50px",
          backgroundColor: "#1DB954",
          color: "white",
          border: "none",
          textDecoration: "none",
          fontWeight: "bold",
          fontSize: "1rem",
          cursor: "pointer",
        }}
      >
        ZALOGUJ SIĘ PRZEZ SPOTIFY
      </button>
    </div>
  );
}

export default App;
